Converts a geographic coordinate to a point in the given views coordinate system.

@example
const pointInView = await this._map.getPointInView([-37.817070, 144.949901]);

@param {Array<Number>} coordinate - A point expressed in the map view's coordinate system.
@return {Array}

Converts a point in the given views coordinate system to a geographic coordinate.

@example
const coordinate = await this._map.getCoordinateFromView([100, 100]);

@param {Array<Number>} point - A point expressed in the given views coordinate system.
@return {Array}

The coordinate bounds(ne, sw) visible in the userss viewport.

@example
const visibleBounds = await this._map.getVisibleBounds();

@return {Array}

Returns an array of rendered map features that intersect with a given point.

@example
this._map.queryRenderedFeaturesAtPoint([30, 40], ['==', 'type', 'Point'], ['id1', 'id2'])

@param  {Array<Number>} coordinate - A point expressed in the map views coordinate system.
@param  {Array=} filter - A set of strings that correspond to the names of layers defined in the current style. Only the features contained in these layers are included in the returned array.
@param  {Array=} layerIDs - A array of layer id's to filter the features by
@return {FeatureCollection}

Returns an array of rendered map features that intersect with the given rectangle,
restricted to the given style layers and filtered by the given predicate.

@example
this._map.queryRenderedFeaturesInRect([30, 40, 20, 10], ['==', 'type', 'Point'], ['id1', 'id2'])

@param  {Array<Number>} bbox - A rectangle expressed in the map views coordinate system.
@param  {Array=} filter - A set of strings that correspond to the names of layers defined in the current style. Only the features contained in these layers are included in the returned array.
@param  {Array=} layerIDs -  A array of layer id's to filter the features by
@return {FeatureCollection}

